create table users
(
    id                              int unsigned auto_increment comment '用户ID'
        primary key,
    union_id                        char(36)                               not null comment '唯一UnionId',
    name                            varchar(64)                            not null comment '用户名',
    sex                             varchar(20)                            null comment '性别',
    profession                      varchar(255)                           null comment '职业',
    birthday                        datetime                               null comment '生日',
    account_id                      varchar(64)                            not null comment '登录名',
    country_calling_code            varchar(8)   default '+86'             not null comment '国际电话区号',
    mobile                          varchar(16)                            not null comment '手机号',
    password                        varchar(255)                           not null comment '密码',
    avatar_file_id                  int unsigned default 0                 not null comment '头像文件ID',
    avatar_file_path                varchar(255)                           null comment '头像文件相对路径',
    avatar_file_url                 text                                   null comment '头像文件URL',
    user_type                       tinyint unsigned                       not null comment '用户类型，0：平台方（admin）、1：S端、2：B端、3：C端',
    distribution_store_id           int unsigned default 0                 not null comment '已绑定的分销店铺',
    can_promote_to_marketing_center tinyint(1)   default 0                 not null comment '可以升级到运营中心（可提交升级申请）',
    is_star_member                  tinyint(1)   default 0                 not null comment '是否是星级管家',
    is_elite_member                 tinyint(1)   default 0                 not null comment '是否是王者管家',
    is_marketing_center             tinyint(1)   default 0                 not null comment '是否是运营中心',
    is_super_member                 tinyint(1)   default 0                 not null comment '是否是超级管家',
    last_signed_in_at               datetime     default CURRENT_TIMESTAMP not null comment '上次登录时间',
    invited_by_user_id              int unsigned                           not null comment '来自该 ID 所指用户的注册邀请',
    comment                         text                                   null comment '备注',
    created_at                      datetime     default CURRENT_TIMESTAMP not null,
    updated_at                      datetime                               null,
    deleted_at                      datetime                               null
)
    collate = utf8mb4_unicode_ci;

create index users_account_id_index
    on users (account_id);

create index users_country_calling_code_index
    on users (country_calling_code);

create index users_distribution_store_id_index
    on users (distribution_store_id);

create index users_invited_by_user_id_index
    on users (invited_by_user_id);

create index users_is_elite_member_index
    on users (is_elite_member);

create index users_is_marketing_center_index
    on users (is_marketing_center);

create index users_is_star_member_index
    on users (is_star_member);

create index users_is_super_member_index
    on users (is_super_member);

create index users_mobile_index
    on users (mobile);

create index users_union_id_index
    on users (union_id);

